import "./App.scss";
import { ProjectComponent } from "./pages/comp/ProjectComponent";
import { LandingPage } from "./pages/LandingPage";
import { Navbar } from "./pages/Navbar";
import { Route, BrowserRouter as Router } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Navbar />
      <LandingPage />
      <ProjectComponent />
    </div>
  );
}

export default App;
